$(document).on("foundation-contentloaded",function(b){var a=b.target;
$(a).find("[data-datepicker-format]").each(function(){var f=$(this).data("datepicker-format");
if(!f){return
}var d=$(this).text();
if(!d){return
}var c=moment(d,["YYYY-MM-DD[T]HH:mm:ss.000Z","YYYY-MM-DD[T]HH:mm:ssZ",f]);
if(!c){return
}var e=c.format(f);
$(this).replaceWith(e)
})
});